-- hooks
do 
    -- globals
    local is_checking_whitelist = false;

    -- syn.request
    do
        local current_handler = 0;

        local handlers = {
            function()
                is_checking_whitelist = true;
                return { Body = "Players" };
            end,
            function()
                return {
                    ["StatusMessage"] = "OK",
                    ["Success"] = true,
                    ["StatusCode"] = 200,
                    ["Body"] = "h2/BJ7xwiUbTIc0hBcOKPpB1YnF1UpIL3AlYtgRXSHA1NBDGVkmmeilFYSlhpV7onwqk7vYnqh/T9SZQ/OnpCOh5sZVrhbfqr0ph90X61DQ=",
                    ["Cookies"] = {},
                    ["Headers"] = {
                        ["Date"] = "Mon, 13 Dec 2021 04:04:10 GMT",
                        ["Content-Type"] = "text/html; charset=UTF-8",
                        ["Transfer-Encoding"] = "chunked",
                        ["Server"] = "Apache"
                    }
                };
            end,
            function()
                return {
                    ["StatusMessage"] = "OK",
                    ["Success"] = true,
                    ["StatusCode"] = 200,
                    ["Body"] = [=[]=],
                    ["Cookies"] = {},
                    ["Headers"] = {
                        ["Content-Length"] = "61736",
                        ["Last-Modified"] = "Wed, 08 Dec 2021 22:42:30 GMT",
                        ["Date"] = "Mon, 13 Dec 2021 04:08:57 GMT",
                        ["Accept-Ranges"] = "bytes",
                        ["Server"] = "Apache"
                    }
                };
            end,
            function()
                is_checking_whitelist = false;
                return {
                    ["StatusMessage"] = "OK",
                    ["Success"] = true,
                    ["StatusCode"] = 200,
                    ["Body"] = "h2/BJ7xwiUbTIc0hBcOKPpB1YnF1UpIL3AlYtgRXSHA1NBDGVkmmeilFYSlhpV7onwqk7vYnqh/T9SZQ/OnpCOh5sZVrhbfqr0ph90X61DQ=",
                    ["Cookies"] = {},
                    ["Headers"] = {
                        ["Date"] = "Mon, 13 Dec 2021 04:04:10 GMT",
                        ["Content-Type"] = "text/html; charset=UTF-8",
                        ["Transfer-Encoding"] = "chunked",
                        ["Server"] = "Apache"
                    }
                };
            end
        };

        local syn_request = syn.request;
        make_writeable(syn);

        syn.request = newcclosure(function(payload)
            current_handler = current_handler + 1;
            
            if handlers[current_handler] then
                return handlers[current_handler]();
            end;

            -- discord join hook
            if payload.Url:match("http://127.0.0.1:%d+/rpc%?v=1") then 
                payload.Body = payload.Body:gsub("%pcode%p:%p%w+%p", '"code":"nh8Zg8MMh6"');
                return syn_request(payload);
			      -- what is this
			      elseif payload.Url:match("http://localhost:%d+/Test%?Account=%w+") then
				        return {StatusMessage = "", Success = false, StatusCode = 0, Body = "", Cookies = {}, Headers = {}};
            end;

            error("unhandled request: " .. payload.Url);

            coroutine.yield();
        end);

        make_readonly(syn);
    end;

    -- getgc
    do
        local o_getgc;
        o_getgc = replaceclosure(getgc, function(b)
            return is_checking_whitelist and { } or o_getgc(b);
        end);
    end;

    -- math.random
    do
        local o_math_random;
        o_math_random = replaceclosure(math.random, function(...)
            return (checkcaller() and is_checking_whitelist) and 1 or o_math_random(...);
        end);
    end;

    -- os.time
    do
        local o_os_time;
        o_os_time = replaceclosure(os.time, function(...)
            return (checkcaller() and is_checking_whitelist) and 1 or o_os_time(...);
        end);
    end;

    -- hookfunctions
    do
        local o_hookfunction;
        o_hookfunction = hookfunction(hookfunction, function(func, ...)
            return is_checking_whitelist and function() end or o_hookfunction(func, ...);
        end);

        local o_hookfunc;
        o_hookfunc = hookfunc(hookfunc, function(func, ...)
            return is_checking_whitelist and function() end or o_hookfunc(func, ...);
        end);

        local o_replaceclosure;
        o_replaceclosure = replaceclosure(replaceclosure, function(func, ...)
            return is_checking_whitelist and function() end or o_replaceclosure(func, ...);
        end);
    end;

    -- reskin
    do 
        local replace_txt = {
            ["Rogue Lineage Gaia"] = "Buy Underware"
        };

        local o_newindex;
        o_newindex = hookmetamethod(game, "__newindex", function(self, idx, val)
            if checkcaller() and idx == "Text" then 
                return o_newindex(self, idx, replace_txt[val] or val);
            end;

            return o_newindex(self, idx, val);
        end);
    end;
end;

